let teamGroupList = []

for (let i = 0; i < teamList.length; i++) {
    let matchIndex = -1;
    for (let j = 0; j < teamGroupList.length; j++) {
        if (teamGroupList[j]['分类'] == teamList[i]['分类']) {
            matchIndex = j;
        }
    }
    if (matchIndex == -1) {
        teamGroupList.push({
            '分类': teamList[i]['分类'],
            list: [teamList[i]]
        })
    } else {
        teamGroupList[matchIndex].list.push(teamList[i])
    }
}


function getById(id) {
    for (let i = 0; i < teamList.length; i++) {
        if (teamList[i].id == id) {
            return teamList[i];
        }
    }
    return null;
}